// src/components/CarCard.js
import React from 'react';

const CarCard = ({ car }) => {
  return (
    <div className="car-card">
      <img src={car.img} alt={car.name} />
      <h2>{car.name}</h2>
      <p>Price: ${car.price}</p>
    </div>
  );
};

export default CarCard;
